import React from "react";
import ReactDOM from "react-dom";
import add from "./Add";
import mult, { div } from "./Mult";


ReactDOM.render(
    <>
    <ol>
    <li>{add(3,4)}</li>
     
     <li>{mult(9,7)}</li>
     <li>{div(9,3)}</li>
     </ol>
     


    </>,
    document.getElementById("root"));
